review_text:
Rose, une brillante jeune fille de dix-huit ans, part a la Nouvelle-Orleans avec sa mere Gertrude, la voiture chargee de vivres et de vetements pour venir en aide aux rescapes de Katrina. Une dispute eclate entre les deux femmes, a la relation difficile, et la voiture de Gertrude et Rose quitte la route, provoquant la mort de la mere dans l'accident. Mais la voiture a egalement fauche une jeune fille noire qui marchait au bord de la route. Mue par la culpabilite, Rose cherche a savoir qui etait la jeune inconnue de son age, et decouvre que c'etait une survivante de Katrina, qui avait parcouru plus de 900 km avant d'arriver a Tuscaloosa. 
 . 
 Afficher l'image d'origineEllen Urbani 
 << Landfall >> nous fait le portrait croise de deux jeunes filles de dix-huit ans qui, malgre leur difference de couleur (Rose est blanche, Rosy est noire - la premiere vient de la classe moyenne, la seconde d'un milieu tres populaire) ont beaucoup de points communs. Toutes deux sont brillantes, et ont ete elevees par des femmes qui les ont eues jeunes et ont du se debrouiller seules pour elever leur enfant : le pere de Rose a quitte sa mere quand celle-ci etait enceinte, celui de Rosy s'est suicide avant que celle-ci ne naisse. On decouvre sous la plume d'Ellen Urbani ces deux relations mere-fille, si proches mais pourtant si differentes. Gertrude, la mere de Rose, est une mere aimante mais qui a eleve sa fille avec durete, pour que celle-ci soit autonome et respectueuse. Rosy, quant a elle, est tres proche de sa mere, une femme gaie et affectueuse. Malheureusement Cilla est bipolaire, et Rosy doit constamment veiller sur sa mere, parfois sous l'emprise de crises tres violentes. 
 ; 
 On suit dans << Landfall >> l'enquete de Rose qui a eu acces au dossier de la jeune morte grace a un policier compatissant, et grace a quelques indices (une page d'annuaire, une carte de visite, un billet de bus) retrace l'itineraire de Rosy pour comprendre qui elle etait et pourquoi elle avait parcouru tant de kilometres au peril de sa vie pour arriver jusqu'a Tuscaloosa - Rose est obsedee par le fait de retrouver la famille de Rosy pour expliquer a ses proches comment elle est morte et leur faire beneficier de sa police d'assurance. En parallele, Ellen Urbani, a travers le portrait de Rosy, nous raconte la catastrophe de Katrina, avec l'eau qui monte dans la maison ou sont refugiees Cilla et Rosy, avec la peur, les dilemmes, la survie coute que coute - a n'importe quel prix. Puis c'est le superdome ou sont parques les survivants, dans des conditions d'hygiene deplorables, sans eau ni nourriture, avec des medecins et des volontaires depasses par les evenements - des descriptions qui ne sont pas sans rappeler celles du Vel d'Hiv. 
 ; 
 La plume d'Ellen Urbani est tres habile, les deux jeunes femmes sont extremement bien incarnees, et je me suis beaucoup attachee a ces deux filles battantes, pretes a tout, l'une pour proteger sa mere, l'autre pour decouvrir la verite sur celle qu'elle a contribue a tuer. Les relations mere-fille, a la fois aimante et triste sont egalement tres bien decrites, tout comme toute la galerie de personnages que les deux jeunes femmes vont rencontrer, a quelques semaines d'intervalle. Et que dire des descriptions de la catastrophe et de ses ravages, poignantes, violentes, rageantes sans jamais etre pleurnichardes. Tout le roman sonne tres juste, sans manicheisme, mais avec beaucoup de profondeur. J'ai quand meme regrette le twist employe par l'auteur. Sans pouvoir bien sur le developper ici, non seulement je l'ai vu arriver a des kilometres, mais je pense qu'il etait tout aussi dispensable qu'il etait un peu trop gros a mes yeux et surtout que le livre n'avait pas besoin de ca pour etre reussi. 
 ;
